        "z": "6b6309c9.fb6d88",
        "name": "",
        "func": "var channels = global.get(\"channels\") || \"{}\"\nchannels = JSON.parse(channels)\n\nif (!channels[msg.channel])\n    channels[msg.channel] = {}\n    \nvar channel = channels[msg.channel]\nchannel.active = true\nchannel.topics = channel.topics || {}\nchannel.topics[msg.topic] = true\nchannel.name = msg.channel \nmsg.payload = channel\nglobal.set(\"channels\", JSON.stringify(channels))\nreturn msg;",
