        "type": "function",
        "z": "a0aa321f.7f538",
        "name": "",
        "func": "var all_nodes_info = global.get(\"all_nodes_info\") || \"{}\"\nall_nodes_info = JSON.parse(all_nodes_info)\n\nif (!all_nodes_info[msg.topic])\n    all_nodes_info[msg.topic] = {}\n    \nvar node = all_nodes_info[msg.topic]\nmsg.node = node \nif (!node.lastFetch) {\n    msg.online = false     \n} else {\n    \n    node.lastFetch = new Date(node.lastFetch)\n    node.onlineInterval = new Date() - node.lastFetch\n    if (node.onlineInterval >= 10000) {\n        msg.online = false\n    } else {\n        msg.online = true\n    }\n}\nmsg.node.online = msg.online\nreturn msg;",
