        "order": 2,
        "width": 0,
        "height": 0,
        "format": "<script>\nvar PLC_TYPE = 'Mitsubishi'\nfunction pToId(msg) {\n    msg = msg || {}\n    msg.p = parseInt(msg.p, 10)\n    switch (PLC_TYPE) {\n        case 'Siemens':\n        case 'Mitsubishi': {\n            msg.p = msg.p + 0\n            break;\n        }\n        case 'Delta': {\n            msg.p = msg.p + 4096\n            break;\n        }\n    }\n}\nfunction send(msg) {\n    msg = msg || {}\n    \n    pToId(msg)\n    console.log(\"send\", msg)\n    if (sendNodered)\n        sendNodered(msg)\n}\n\nfunction updateGlobalData(msg) {\n    $(\"svg title\").each(function() {\n    \tvar $this = $(this)\n    \tvar option = $this.html()\n    \ttry {\n        \toption = JSON.parse(option)\n    \t\tconsole.log(option)\n    \t\tvar parent = $this.parent()\n    \t\tvar value\n    \t\tswitch (option.type) {\n    \t\t    case \"title\": {\n    \t\t        if (option.id && msg.payload[option.id]) {\n    \t\t            parent.find(\"tspan\").html(msg.payload[option.id])\n    \t\t        }\n     \t\t        break;\n    \t\t    }\n    \t\t} \n    \t} catch(e) {\n    \t\tconsole.log(\"Error\", option, e)\n    \t}\n    })\n}\nfunction updateSvgData(msg) {\n    console.log(\"updateSvgData\", msg)\n    $(\"svg title\").each(function() {\n    \tvar $this = $(this)\n    \tvar option = $this.html()\n    \ttry {\n        \toption = JSON.parse(option)\n    \t\tconsole.log(option)\n    \t\tvar parent = $this.parent()\n    \t\tvar value\n    \t\toption.flow = option.flow || 0\n    \t\toption.bit = option.bit || 0\n    \t\tconsole.log(msg.payload[option.flow].state)\n    \t\tmsg.payload[option.flow].state = parseInt(msg.payload[option.flow].state, 10)\n    \t\tswitch (option.type) {\n    \t\t    case \"bit\": {\n    \t\t        value = msg.payload[option.flow].state\n    \t\t        console.log(\"bit\", option.bit, msg.payload[option.flow].state)\n                    value = (value >> option.bit) & 1\n    \t\t        break;\n    \t\t    }\n    \t\t    case \"integer\": {\n    \t\t        value = msg.payload[option.flow].state || 0\n                \n    \t\t        break;\n    \t\t    }\n    \t\t} \n    \t\tif (value == option.value) {\n    \t\t    parent.show()\n    \t\t} else {\n    \t\t    parent.hide()\n    \t\t}\n    \t} catch(e) {\n    \t\tconsole.log(\"Error\", option, e)\n    \t}\n    })\n    return true\n}\nvar sendNodered = this.scope.send\n</script>",
